import React, { Component } from 'react'

export default class Autocomplete extends Component {
  render() {
    return (
      <React.Fragment>
        <input
            type="text"
            id="name"
            name="name"
            className="form-control"
            placeholder="Medicine Name "
        />
      </React.Fragment>
    )
  }
}
